_map:
if (item.OWNER)
    emit(item.OWNER, 
        { fvLand : parseInt(item.NEW_FV_L), 
        fvTotal : parseInt(item.NEW_FV_T),
        count : 1
        });

_reduce:
var total = values.reduce(function(a, b) {
    return { fvLand: (a.fvLand + b.fvLand), 
        fvTotal: (a.fvTotal + b.fvTotal), 
        count: (a.count + b.count) }; }); 
emit(total);

_finalize:
reduction.sort(function(a,b){
    return b[1].fvTotal -a[1].fvTotal;
    }); 
if (reduction.length > 10) 
    reduction.length = 10; 
emit(reduction);
